import React from 'react';

function Select({ chooseValue }) {
  return (
    // eslint-disable-next-line jsx-a11y/no-noninteractive-element-interactions
    <ul className="info-page__select" onClick={chooseValue} onKeyDown={chooseValue}>
      <li className="info-page__select-item" value="m1">1 minute</li>
      <li className="info-page__select-item" value="m15">15 minute</li>
      <li className="info-page__select-item" value="h1">1 hour</li>
      <li className="info-page__select-item" value="h6">6 hours</li>
      <li className="info-page__select-item" value="h12">12 hours</li>
      <li className="info-page__select-item" value="d1">1 day</li>
    </ul>
  );
}

export default Select;
